.title-fade-out{
    opacity: 0;
    animation-name: fade-out;
    animation-duration: 2s;
}

/*names same as defined in keyframe, i.e. fade-in for fade-in below and viceversa*/
.title-fade-in{
    opacity: 100;
    animation-name: fade-in;
    animation-duration: 2s;
}

/*Class for animation*/
@keyframes fade-out {
    from {opacity: 100;}
    to {opacity: 0;}
}

@keyframes fade-in {
    from {opacity: 0;}
    to {opacity: 100;}
}

.track {
    width: 250px;
    height: 250px;
    display: inline-block;
    position: relative;
    cursor: pointer;
    margin: 20px;
}

.track-image {
    width: 250px;
    height: 250px;
}

.track-text {
    background-color: black;
    width: 250px;
    bottom: 0px;
    color: white;
    padding: 5px;
    position: absolute; 

}
